INSERT INTO `kata_bijak` (`id`, `kata_bijak`) VALUES
(3, 'Bermimpilah yang besar dan selalu berani untuk gagal.'),
(4, 'Belajarlah dari hari hari kemarin dan hiduplah untuk hari ini, lalu berharaplah untuk hari esok.'),
(5, 'Kesulitan yang sebenarnya ialah mengatasi caramu berpikir mengenai diri kamu sendiri.'),
(6, 'Tidak perlu menjadi seseorang yang serba bisa, tekuni saja salah satu bidang yang paling kamu suka, kemudian jadilah seseorang yang hebat dengan bidang tersebut.'),
(7, 'Tidak ada kata tidak mungkin, sebelum kamu sempat mencobanya.'),
(8, 'Jangan pernah takut menghadapi masa depan, hadapi lalu perjuangkanlah masa depan itu.'),
(9, 'Apabila kamu mampu memimpikannya, maka kamu juga bisa melakukannya.'),
(10, 'Ingatlah bahwa hari ini hanyalah hari yang buruk dan bukan kehidupan yang buruk.'),
(11, 'Jangan pernah menyesali masa lalu yang pernah terjadi sebelumnya, tetapi belajarlah dari masa lalu tersebut.'),
(12, 'Ada begitu banyak cara agar kamu bisa maju, akan tetapi hanya ada satu cara untuk tetap diam.'),
(13, 'Fokuslah untuk mencapai tujuanmu, meskipun banyak hal yang menarik dalam perjalanannya.'),
(14, 'Tidak peduli bagaimana kerasnya kehidupan yang kamu miliki di masa lalu, kamu selalu bisa memulainya kembali.'),
(15, 'Impian tidak dapat terwujud dengan sendirinya, akan tetapi impian akan datang ketika seseorang berusaha untuk meraihnya.'),
(16, 'Perjalanan akan menjadi jauh lebih muda, apabila kamu tidak membawa masa lalumu.'),
(17, 'Berjalanlah jangan berlari, karena hidup adalah perjalanan dan bukannya pelarian.'),
(18, 'Jangan hanya terus bermalas-malasan setiap hati, jadikan hidup kamu jadi lebih bermakna dengan bekerja lebih giat.'),
(19, 'Hidup bukan hanya mengenai mendapatkan serta memiliki belaka, akan tetapi juga mengenai memberi serta menjadi sesuatu.'),
(20, 'Nikmatilah hal-hal kecil yang ada dalam hidup, sebab suatu hari nanti kamu akan melihat ke belakang dan kemudian menyadari bahwa itu adalah hal-hal besar.'),
(21, 'Kemana pun diri kamu pergi, lakukanlah segala sesuatu dengan segenap hati.'),
(22, 'Keberhasilan dalam hidup, hanya mampu didapatkan ketika seseorang mau berjuang dengan keras untuk mendapatkannya.'),
(23, 'Kamu memiliki waktu terbatas, sehingga jangan sia-siakan waktu itu untuk menjalani kehidupan orang lain.'),
(24, 'Bersiaplah dalam kesunyian dan biarkan kesuksesan yang membuat hidupmu menjadi bising.'),
(25, 'Ketika kita masih diberikan kesempatan untuk bangun di pagi hari, itu artinya Tuhan masih memberikan kesempatan pada kita untuk melakukan pekerjaan yang harus kita lakukan.'),
(26, 'Hidup merupakan sebuah pertanyaan serta bagaimana manusia menjalani kehidupan merupakan jawabannya.'),
(27, 'Hidup itu membutuhkan suatu perjuangan, sebab tidak ada satu hal pun yang mampu sukses tanpa adanya perjuangan di dalamnya.'),
(28, 'Tidak ada perjuangan tanpa adanya rasa sakit, akan tetapi percayalah bahwa rasa sakit itu hanya sementara dan rasa bahagia akan terasa selamanya.'),
(29, 'Kebahagiaan harus terus dirasakan dalam perjalanan hidup, dan bukan hanya menjadi tujuan hidup belaka.'),
(30, 'Hidup memang penuh dengan perjuangan dan dalam perjalanan berjuang tersebut, impian merupakan bahan bakar yang dapat membakar rasa semangat kita untuk menuju impian serta cita-cita.'),
(31, 'Terkadang kita diuji, bukan untuk menunjukan kelemahan yang kita miliki, akan tetapi untuk menemukan kekuatan yang sebenarnya kita miliki.'),
(32, 'Dalam hidup, kita harus mampu menentukan sikap, sebab hanya dengan sikap maka kita akan mampu bertahan di tengah kuatnya badai ujian.'),
(33, 'Berbangga dirilah dengan siapa diri kamu sebenarnya dan jangan pernah merasa malu dengan cara orang lain melihat dirimu sebenarnya.'),
(34, 'Kesulitan yang sebenarnya ialah mengatasi caramu berpikir tentang diri kamu sendiri.'),
(35, 'Menjadi berani artinya bahwa kamu harus mengetahui bahwa ketika diri kamu gagal, artinya kamu tidak gagal untuk selamanya.'),
(36, 'Jadilah diri kamu sendiri, orang lain tidak perlu menyukai diri mu dan kamu tidak perlu peduli akan hal tersebut.'),
(37, 'Ketika dalam suatu perjuangan ada tantangan yang besar, berarti dalam setiap keberhasilan ada hasil yang lebih besar pula menanti dirimu.'),
(38, 'Semua manusia memiliki kesempatan yang sama, sehingga tetaplah semangat untuk melakukan pekerjaanmu sebaik mungkin.'),
(39, 'Cara paling baik untuk membayar momen-momen indah ialah dengan menikmatinya.'),
(40, 'Tidak peduli hal apapun yang kamu alami, selalu ada cahaya di ujung terowongan.'),
(41, 'Kamu akan tumbuh menjadi seseorang yang dewasa dan ketika waktu itu tiba, kamu akan menertawakan diri kamu sendiri.'),
(42, 'Menikahlah dengan pria yang seusia dengan mu, ketika kecantikan dirimu memudar, maka penglihatannya pun juga akan berkurang.'),
(43, 'Ingatlah bahwa hari ini adalah hari esok yang sebelumnya kamu khawatirkan.'),
(44, 'Hidup itu sulit untuk dijalani dan akan menjadi lebih sulit ketika kamu adalah orang yang bodoh.'),
(45, 'Ketika hidup tidak memberikan dirimu senyuman, beri saja kehidupan sedikit gelitikan.'),
(46, 'Jangan takut karena kamu berjalan dengan lambat, tetapi takutlah jika kamu hanya bisa berdiam diri.'),
(47, 'Hidup pasti banyak rintangan, karena kalau banyak rantangan itu artinya katering!'),
(48, 'Kebahagiaan hanyalah kesedihan yang belum terjadi.'),
(49, 'Setiap kali kamu bisa menemukan humor dalam situasi-situasi yang sulit, itu artinya kamu telah menang.'),
(50, 'Semakin awal kamu memulai pekerjaanmu, maka semakin awal pula kamu akan melihat hasil yang akan kamu tuai.'),
(51, 'Doronglah diri kamu sendiri, sebab tidak ada orang lain yang akan melakukan hal itu untuk dirimu.'),
(52, 'Jangan pernah berhenti ketika kamu lelah, berhentilah ketika kamu telah selesai.'),
(53, 'Bertindak merupakan kunci yang dasar untuk seluruh kesuksesan yang ingin kamu raih.'),
(54, 'Kemuliaan yang paling besar dalam hidupa tidak terletak pada ketangguhan yang dimiliki seseorang, akan tetapi dalam bangkit setiap kali ia terjatuh.'),
(55, 'Kamu tidak dilahirkan untuk menjadi sosok yang sempurna, akan tetapi untuk menjadi dirimu yang apa adanya.'),
(56, 'Jangan pernah katakan tidak mungkin, akan tetapi katakan saja bagaimana caranya.'),
(57, 'Apabila kamu tengah mencari seseorang yang mampu mengubah hidupmu, maka lihatlah ke cermin.'),
(58, 'Milikilah keyakinan yang tidak akan tergoyahkan akan diri kamu sendiri untuk menjadi sosok yang selalu kamu inginkan.'),
(59, 'Kamu adalah wujud kesuksesan yang sejati, sehingga ketika kamu dapat mempercayai diri sendiri, maka cintailah diri sendiri dan tetap menjadi diri sendiri.'),
(60, 'Ketika ada seseorang mengatakan bahwa kamu telah berubah, sebenarnya itu hanyalah karena kamu berhenti melakukan apa yang mereka ingin kamu lakukan.'),
(61, 'Jangan pernah membuat suatu keputusan yang permanen hanya untuk perasaan yang sementara waktu.'),
(62, 'Berani dalam mengambil keputusan, maka kamu telah melangkah sepuluh kali lebih cepat menuju kesuksesan.'),
(63, 'Realitas kehidupan yang kamu miliki ialah deskripsi mengenai jiwa serta pikiran kamu.'),
(64, 'Mereka bilang bahwa impian yang saya miliki terlalu besar, akan tetapi saya bilang bahwa cara mereka berpikir yang terlalu kecil.'),
(65, 'Usai kamu mengganti pikiran-pikiran negatif dengan pikiran positif, maka kamu pun akan mulai mendapatkan hasil yang positif.'),
(66, 'Beranilah untuk mengambil risiko, sebab tidak ada yang mampu menggantikan pengalaman.'),
(67, 'Kegagalan hanya dibuat oleh mereka yang telah gagal menjadi sosok yang berani dan bukan oleh mereka yang berani untuk gagal.'),
(68, 'Hanya ada satu hal yang mampu membuat mimpi tidak tercapai, yaitu adalah ketakutan akan kegagalan.'),
(69, 'Prestasi tidak dapat diraih tanpa adanya semangat.'),
(70, 'Jangan pernah merasa khawatir tentang kegagalan, akan tetapi khawatirlah tentang peluang yang telah kamu lewatkan ketika kamu tidak mencoba untuk melakukan sesuatu.'),
(71, 'Bermimpilah dalam hidup dan jangan hidup dalam mimpi -Andrea Hirata.'),
(72, 'Saya menangis karena saya tidak punya sepatu, lalu saya bertemu dengan seorang pria yang tidak punya kaki.'),
(73, 'Jangan pernah berhenti menunjukkan kepada seseorang betapa merekasangat berartibagimu.'),
(74, 'Lebih baik menangis di tengah hujan sehingga tidak ada yang bisa mengerti bahwa kamu bahagia atau kesakitan.'),
(75, 'Beberapa orang berpura-pura kuat, tapi mereka hancur di dalam.'),
(76, 'Diam adalah jawaban terbaik dari semua pertanyaan bodoh, dan senyum adalah reaksi terbaik dalam semua situasi kritis.'),
(77, 'Jelajahi hal-hal baru dan belajar darinya karena hidup ini terlalu singkat.'),
(78, 'Saya berharap saya bisa kembali ke hari-hari buruk dan mempelajari pelajaran yang saya lewatkan.'),
(79, 'Hidup ituseperti resep dengan semua bahan yang sempurna.'),
(80, 'Kamu tidak bisa mekar begitu cepat, kamu harus tumbuh dulu.'),
(81, 'Jika kamu menunggu sesuatu terjadi, kamu sudah terlambat.'),
(82, 'Hidup hanya datang sekali, jadi lakukan apa yang membuatmu bahagia, dan berada di sekitar orang yang membuatmu tersenyum.'),
(83, 'Senyuman terbaik datang setelah saat-saat tersulit.'),
(84, 'Jangan pernah biarkan kesedihan masa lalumu membuatmu merusak kebahagiaan saat ini.'),
(85, 'Hidup ditentukan oleh keputusanmu, jika kamu menginginkan hasil berbeda buatlah keputusan yang berbeda.'),
(86, 'Kadang-kadang hidup seperti permainan, entah menang atau kalah tetapi kamu harus mengerahkan semua upaya terbaik.'),
(87, 'Kamu tidak memiliki kekuatan untuk kembali dan mengubah masa lalu, tetapi kamu memiliki kekuatan untuk memulai dari tempatmu sekarang dan mengubah masa depan.'),
(88, 'Hidup adalah perjalanan panjangdi mana kamu akan menemukan ribuan keajaiban, perhatikan mereka.'),
(89, 'Satu bab buruk dalam hidup itu tidak berarti adalah akhir, tetapi itu adalah awal dari babak baru dalam hidupmu.'),
(90, 'Pemandangan terbaik datang setelah pendakian tersulit.'),
(91, 'Jangan sampai mengucap kata menyerah jika masih ingin hidupmu terus berlanjut.'),
(92, 'Menunggu dan menanti itu berbeda, namun tidak ada yang menyenangkan.'),
(93, 'Lupakan apa yang tertinggal, pikirkan ke depan, dan nikmati saat ini.'),
(94, 'Kamu harus menangkap momen spesial dalam hidup yang akan memberikan kebahagiaan seumur hidup.'),
(95, 'Hidup adalah kumpulan momen yang kamu simpan di hatimu.'),
(96, 'Terkadang hal-hal kecil membuat hidup layak dijalani.'),
(97, 'Jika kamu menjalani hidup dengan pilihan orang lain, maka hidupmu tidak akan lagi menjadi milikmu.'),
(98, 'Sehati bukan karena memberi, tapi sehati karena saling memahami.'),
(99, 'Sulit untuk memulai babak baru dalam hidup ketika kamu tahu seseorang tidak akan ada di sana, tetapi ceritanya harus terus berjalan.'),
(100, 'Jika kamu ingin tumbuh, serahkan semua yang membuatmu jatuh.'),
(101, 'Kamu tidak bisa kembali dan mengubah hal-hal yang ada, tetapi kamu bisa belajar dari itu dan mengambil tindakan sekarang.'),
(102, 'Jadilah seperti ombak, kuat dan tak terbendung.'),
(103, 'Kamu harus mengambil resiko, kamu harus menerima perubahan, maka hanya kamu yang akan memahami keajaiban hidup sepenuhnya.'),
(104, 'Dalam hidup, kamu akan mendapatkan teman, tetapi hanya satu yang sejati di saat-saat terburukmu.'),
(105, 'Jangan pernah membiarkan kesedihan masa lalu membuatmu merusak kebahagiaan masa kini.'),
(106, 'Hal-hal baik membutuhkan waktu, jadi bersikaplah positif dan sabar.'),
(107, 'Apapun yang terjadi selama setahun terakhir iniBersyukurlah karena itu membuatmu lebih kuat menghadapi masa depan.'),
(108, 'Jangan pernah melupakan masa lalu karena akan selalu menjadi bagian dari hidup, tapi saya bisa belajar darinya dan mempersiapkan masa depan.'),
(109, 'Kamu pencipta hidupmu sendiri dan bisa tidak mengubah apa pun untuk orang lain.'),
(110, 'Ubah dirimu untuk kebaikan, bukan untuk orang lain.'),
(111, 'Kemenangan kecil itulah yang memberimu keberanian dan kepercayaan diri untuk mencapai hal-hal yang lebih besar dalam hidup.'),
(112, 'Ketika kamu memperlakukan orang dengan baik, orang-orang yang sama itu mungkin tidak memperlakukanmu dengan cara yang samaTetapi jika kamu memperhatikan, kamu akan melihat bahwa Allah telah mengirim orang lain yang memperlakukanmu dengan lebih baik. - Omar Suleiman'),
(113, 'Banyak orang yang telah meninggal, tapi nama baik mereka tetap kekalDan banyak orang yang masih hidup, tapi seakan mereka orang mati yang tak berguna. - Imam Syafi i'),
(114, 'Dan jiwamu, jika tidak kau sibukkan di dalam kebenaran maka ia akan menyibukkanmu dalam kebathilan. - Imam Syafi i'),
(115, 'Di antara tanda matinya hati, adalah tidak adanya perasaan sedih atas kesempatan beramal yang engkau lewatkan dan tidak adanya penyesalan atas pelanggaran yang engkau lakukan. - Ibnu Athaillah'),
(116, 'Dunia ini hanya memiliki tiga hari: Hari kemarin, ia telah pergi bersama dengan semua yang menyertainyaHari esok, kamu mungkin tak akan pernah menemuinyaHari ini, itulah yang kamu miliki, maka beramallah di hari ini. - Hasan al Bashri'),
(117, 'Hidup ini terlalu singkat untuk mengejar sesuatu yang tidak membawa kita semakin dekat dengan surga. - Boona Mohammed'),
(118, 'Hiduplah sebagaimana semaumu, tetapi ingat, bahwa engkau akan matiDan cintailah siapa yang engkau sukai, namun ingat, engkau akan berpisah dengannyaDan berbuatlah seperti yang engkau kehendaki, namun ingat, engkau pasti akan menerima balasannya nanti. - Imam Ghazali'),
(119, 'Jalanilah kehidupan di dunia ini tanpa membiarkan dunia hidup di dalam dirimu, karena ketika perahu berada di atas air, ia mampu berlayar dengan sempurna, tetapi ketika air masuk ke dalamnya, perahu itu tenggelam. - Ali bin Abi Thalib'),
(120, 'Jangan terlalu bergantung pada siapa pun di dunia iniKarena bayanganmu saja akan meninggalkanmu di saat gelap. - Ibnu Taymiyyah'),
(121, 'Kehidupan dunia dan akhirat di hati seorang manusia ibarat dua skala keseimbangan, ketika salah satunya menjadi berat, maka yang lain akan menjadi ringan. - Amribn Abdullah'),
(122, 'Kehidupan itu cuma dua hariSatu hari untukmu dan satu hari melawanmuMaka pada saat ia untukmu, jangan bangga dan gegabah dan pada saat ia melawanmu bersabarlahKarena keduanya adalah ujian bagimu. - Ali bin Abi Thalib'),
(123, 'Lidah seseorang dapat menggambarkan bagaimanakah hatinya. - Ibnu Qayyim'),
(124, 'Memangnya kenapa jika hidup ini tidak sempurna? Hidup ini bukanlah surga. - Nouman Ali Khan'),
(125, 'Terkadang Allah membiarkan kamu untuk merasakan kepahitan dunia ini supaya kamu dapat sepenuhnya menghargai manisnya iman. - Omar Suleiman'),
(126, 'Barang siapa belum merasakan pahitnya belajar walau sebentar, maka akan merasakan hinanya kebodohan sepanjang hidupnya. - Imam Syafi i'),
(127, 'Betapa banyak kegetiran dan kesulitan yang dialami, yang bisa memalingkan jalan ibadahKecuali untuk orang-orang yang bersabar dan selalu istiqomah. - Erick Yusuf'),
(128, 'Jika terdapat banyak kebutuhan yang harus dipenuhi, maka mulailah dari yang terpenting dan mendesak. - Imam Syafi i'),
(129, 'Orang berilmu pengetahuan ibarat gula yang mengundang banyak semutDia menjadi cahaya bagi diri dan sekelilingnya. - Abdullah Gymnastiar'),
(132, 'Jika Allah bersamamu, maka jangan takut kepada siapa sajaAkan tetapi jika Allah sudah tidak lagi bersamamu, maka siapa lagi yang bisa diharapkan olehmu. - Hasan Al-Banna'),
(133, 'Jiwa Muhammad penuh kebaikan, pengaruhnya membekas dan takkan terlupakan oleh orang-orang yang mengenalnya. - Diwan Chand Sharma, The Prophet of the East'),
(134, 'Menghindarkan telinga dari mendengar hal-hal yang tidak baik merupakan suatu keharusan, sebagaimana seseorang mensucikan tutur katanya dari ungkapan buruk. - Imam Syafii'),
(135, 'Jadikan akhirat di hatimu, dunia di tanganmu, dan kematian di pelupuk matamu. - Imam Syafii'),
(136, 'Bila engkau pulang ke alam baka, tidak membawa bekal takwa, kau lihat orang-orang membawanya pada hari perhimpunanEngkau akan menyesal, karena engkau tidak seperti merekaMereka mempunyai persiapan sedang engkau tidak memilikinya. - Ibnu Qayyim'),
(137, 'Jika engkau bertakwa kepada Allah, maka engkau tidak butuh kepada manusiaSedang apabila engkau takut kepada manusia, mereka tidak dapat memenuhi kebutuhanmu kepada Allah sedikit pun. - Sufyan Ats-Tsauri'),
(138, 'Jika semua orang menjauh ketika engkau mendapat kesulitan, maka ketahuilah bahwa Allah SWT ingin membuatmu kuat dan Ia akan menjadi penolongmu. - Imam Syafi i'),
(139, 'Hatiku tenang karena mengetahui bahwa apa yang melewatkanku tidak akan pernah menjadi takdirku, dan apa yang ditakdirkan untukku tidak akan pernah melewatkanku. - Umar bin Khattab'),
(140, 'Jangan berduka, apa pun yang hilang darimu akan kembali lagi dalam wujud lain. - Jalaluddin Rumi'),
(141, 'Jika kamu mampu bersabar sebentar pada saat dirimu marah, maka hal itu dapat menghindarkanmu dari ribuan penyesalan di masa yang akan datang. - Ali bin Abi Thalib'),
(142, 'Kesabaran adalah ketika hati tidak merasa marah terhadap apa yang sudah ditakdirkan dan mulut tidak mengeluh. - Ibnu Qayyim'),
(143, 'Kesabaran itu ada dua macam: Sabar atas sesuatu yang tidak kau ingin dan sabar menahan diri dari sesuatu yang kau ingini. - Ali Bin Abi Thalib'),
(144, 'Memang sangat sulit untuk bersabar, tetapi menyia-nyiakan pahala dari kesabaran itulah yang lebih buruk. - Abu Bakar'),
(145, 'Orang yang terkaya adalah orang yang menerima pembagian (takdir) dari Allah dengan senang hati. - Ali bin Husein'),
(146, 'Petunjuk tidak bisa dicapai kecuali dengan pengetahuan, dan arah tujuan yang benar tidak bisa dituju kecuali dengan kesabaran. - Ibnu Taimiyah'),
(147, 'Sabar memiliki dua sisi, sisi yang satu adalah sabar, sisi yang lain adalah bersyukur kepada Allah. - Ibnu Mas ud'),
(148, 'Untuk mendapatkan apa yang kamu suka, pertama kamu harus sabar dengan apa yang kamu benci. - Imam Al Ghazali'),
(149, 'Ketahuilah bahwa rasa syukur merupakan tingkatan tertinggi, dan ini lebih tinggi daripada kesabaran, ketakutan (khauf), dan keterpisahan dari dunia (zuhud). - Imam al-Ghazali'),
(150, 'Aku mencintaimu karena agama yang ada padamuJika kau hilangkan agama dalam dirimu, maka hilanglah cintaku padamu. - Imam An Nawawi'),
(151, 'Benar, mencintai makhluk itu sangat berpeluang mengalami kehilanganKebersamaan bersama makhluk juga berpeluang mengalami perpisahanHanya cinta kepada Allah yang tidak. - Habiburrahman El Shirazy'),
(152, 'Cinta bukan melemahkan hati, bukan membawa putus asa, bukan menimbulkan tangis sedu sedanTetapi cinta menghidupkan pengharapan, menguatkan hati dalam perjuangan menempuh onak dan duri penghidupan. - Buya Hamka'),
(153, 'Cintailah kekasihmu sekadarnya saja, siapa tahu nanti akan jadi musuhmuDan bencilah musuhmu sekadarnya saja, siapa tahu nanti akan jadi kekasihmu. - Ali bin Abi Thalib'),
(154, 'Jangan berhenti berdoa untuk yang terbaik bagi orang yang kau cintai. - Ali bin Abi Thalib'),
(155, 'Jangan mencintai orang yang tidak mencintai AllahJika mereka bisa meninggalkan Allah, maka mereka juga akan meninggalkanmu. - Imam Asy Syafii'),
(156, 'Kau tidak akan pernah menemukan cinta sejati sampai kau belajar mencintai Allah terlebih dahulu. - Boonaa Mohammed'),
(157, 'Orang yang suka berkata jujur akan mendapatkan tiga keuntungan, yaitu kepercayaan, cinta, dan rasa hormat. - Ali bin Abi Thalib'),
(158, 'Pria mengimpikan wanita sempurnaWanita menginginkan pria sempurnaMereka tidak tahu bahwa Allah menciptakan mereka untuk menyempurnakan satu sama lain. - Ahmad Alshugairi'),
(159, 'Tidak ada wanita di belakang seorang pria hebatWanita itu ada di sampingnyaIa ada bersamanya, bukan di belakangnya. - Tariq Ramadan'),
(160, 'Silahkan hina diriku sepuas kalian, aku akan tetap diam sajaBukannya aku tidak punya jawaban, tapi singa selalu tidak akan membalas gonggongan anjing. - Imam Syafi i'),
(161, 'Aku sudah pernah merasakan semua kepahitan dalam hidup dan yang paling pahit ialah berharap kepada manusia. - Ali bin Abi Thalib'),
(162, 'Orang yang paling aku sukai adalah dia yang menunjukkan kesalahanku. - Umar bin Khattab'),
(163, 'Banyak orang yang mengatakan bahwa mencintai wanita itu sangat menyiksaTapi, sebenarnya yang sangat menyiksa itu adalah mencintai orang yang tidak mencintaimu. - Imam Syafi i'),
(164, 'Yang paling besar di bumi ini bukan gunung dan lautan, melainkan hawa nafsu yang jika gagal dikendalikan maka kita akan menjadi penghuni neraka. - Abu Hamid Al Ghazali'),
(165, 'Cobaan hidupmu bukanlah untuk menguji kekuatan dirimu, tapi menakar seberapa besar kesungguhan dalam memohon pertolongan kepada Allah. - Ibnu Qoyyim'),
(166, 'Janganlah engkau mengucapkan perkataan yang engkau sendiri tak suka mendengarnya jika orang lain mengucapkannya kepadamu. - Ali bin Abi Thalib'),
(167, 'Orang yang tidak dapat menguasai matanya maka hatinya tidak ada harganya. - Umar bin Khattab'),
(168, 'Hiduplah kamu bersama manusia sebagaimana pohon yang berbuah, mereka melemparinya dengan batu, tetapi ia membalasnya dengan buah. - Abu Hamid Al Ghazali'),
(169, 'Kebaikan itu ada di lima perkara, yaitu kekayaan hati, bersabar atas kejelekan orang lain, mengais rezeki yang halal, taqwa, dan yakin akan janji Allah SWT. - Imam Syafi i'),
(170, 'Barang siapa menyalakan api fitnah, maka dia sendiri yang akan menjadi bahan bakarnya. - Ali bin Abi Thalib'),
(171, 'Sesungguhnya seorang mukmin adalah penanggung jawab atas dirinya karena hendaknya ia senantiasa menginstrospeksi diri karena Allah semata. - Hasan Al Bashri'),
(172, 'Menuntut ilmu adalah takwaMenyampaikan ilmu adalah ibadahMengulang-ulang ilmu adalah zikirMencari ilmu adalah jihad. - Abu Hamid Al Ghazali'),
(173, 'Pengetahuan yang baik adalah yang memberikan manfaat, bukan yang hanya diingat. - Imam Syafi i'),
(174, 'Pilar kepemimpinan itu ada lima, yakni perkataan yang benar, menyimpan rahasia, menepati janji, senantiasa memberi nasihat, dan menunaikan amanah. - Imam Syafi i'),
(175, 'Barang siapa yang menginginkan kejernihan hatinya, hendaknya ia lebih mengutamakan Allah daripada menuruti berbagai keinginan hawa nafsunya. - Ibnu Qoyyim Rahimahullah'),
(176, 'Angin tidak berhembus untuk menggoyangkan pepohonan, melainkan menguji kekuatan akarnya. - Ali bin Abi Thalib'),
(177, 'Hidup menjadi gelisah ketika kita terbiasa berandai-andai dalam menyikapi persoalan hidup. - Aa Gym'),
(178, 'Hadapi kawan atau musuhmu itu dengan wajah yang menunjukkan kegembiraan, kerelaan penuh kesopanan dan ketenanganJangan menampakkan sikap angkuh dan sombong. - Abu Hamid Al Ghazali'),
(179, 'Siapa yang memberi nasihat saudaranya di tempat yang sunyi, maka ia telah melakukan perbaikan pada dirinyaBarang siapa yang memberi nasihat saudaranya di tempat keramaian, sesungguhnya ia membuka aib dan menghianatinya. - Imam Syafi i'),
(180, 'Menangislah pada waktu sendiri agar Allah memperhatikanmu, sehingga Dia mengasihi air matamu dan kamu termasuk orang yang beruntung. - Hasan Al Bashri'),
(181, 'Menggebunya semangat tak akan mampu menerobos benteng takdir. - Ibnu Athaillah'),
(182, 'Balas dendam terbaik adalah menjadikan dirimu lebih baik. - Ali bin Abi Thalib'),
(183, 'Ilmu itu kehidupan hati daripada kebutaan, sinar penglihatan daripada kezaliman, dan tenaga badan daripada kelemahan. - Abu Hamid Al Ghazali'),
(184, 'Berpikirlah sebelum menentukan suatu ketetapan, atur strategi sebelum menyerang, dan musyawarahkan terlebih dahulu sebelum melangkah maju ke depan. - Imam Syafi i'),
(185, 'Kenalkan rasa kasih sayang dalam hati saudaramu dengan cara memperkenalkannya terlebih dahulu di dalam hatimu. - Muhammad Al Baqir'),
(186, 'Apabila akal tidak sempurna maka kurangilah berbicara. - Ali bin Abi Thalib'),
(187, 'Empat hal yang menghambat datangnya rezeki adalah tidur di waktu pagi, sedikit sholat, malas-malasan, dan berkhianat. - Ibnu Qayyim'),
(188, 'Marahnya orang yang mulia bisa terlihat dari sikapnya, dan marahnya orang yang bodoh terlihat dari ucapan lisannya. - Imam Syafi i'),
(189, 'Jangan biarkan hati Anda mendapatkan kesenangan dengan pujian dari orang lain atau Anda akan sedih dengan kecaman mereka. - Abu Hamid Al Ghazali'),
(190, 'Apabila sesuatu yang kau senangi tidak terjadi maka senangilah apa yang terjadi. - Ali bin Abi Thalib'),
(191, 'Beruntunglah orang-orang yang mengetahui kekurangan dirinya lebih banyak daripada yang diketahui manusia (orang lain).'),
(192, 'Jika Anda jengkel terhadap setiap gesekan, bagaimana cermin Anda akan dipoles. - Jalaluddin Rumi'),
(193, 'Jangan terpesona dengan kehidupanmu di dunia sehingga meninggalkan kehidupan akhirat. - Imam Syafi i'),
(194, 'Carilah teman untuk menenangkan hati dan pikiran, maka perhatikanlah baik-baik tentang keselamatanmu dan kesejahteraannya. - Abu Hamid Al Ghazali'),
(195, 'Kemarin saya pintar, jadi saya ingin mengubah duniaHari ini saya bijaksana, jadi saya mengubah diri saya sendiri. - Jalaluddin Rumi'),
(196, 'Kesabaran adalah akhlak mulia, yang dengannya setiap orang dapat menghalau segala rintangan. - Imam Syafi i'),
(197, 'Raihlah ilmu, dan untuk meraih ilmu belajarlah tenang dan sabar. - Umar bin Khattab'),
(198, 'Saran itu mudah, yang sulit adalah menerimanya, karena itu pahit dalam rasa. - Abu Hamid Al Ghazali'),
(199, 'Bila kau cemas dan gelisah akan sesuatu, masuklah ke dalamnya sebab ketakutan menghadapinya lebih menganggu daripada sesuatu yang kau takuti sendiri. - Ali bin Abi Thalib'),
(200, 'Setiap orang punya jatah gagal, habiskan jatah gagalmu ketika kamu masih muda. (Dahlan Iskan)'),
(201, 'Jangan menabung apa yang tersisa, tapi habiskan apa yang tersisa setelah menabungnya. (Warren Buffet)'),
(202, 'Jadilah  orang kecil  yang berpikir besarJangan jadi  orang besar  yang berpikir kecil atau sempit. (Andrie Wongso)'),
(203, 'Ingat, setelah gagal harus terus melangkah dan jangan pernah berhenti karena kegagalan yang sesungguhnya adalah ketika kita berhenti. (Bob Sadino)'),
(204, 'Tidak usah takut gagal, bekerjalah semaksimal mungkin dan percayalah bahwa semua jerih payah kita akan diperhitungkan oleh Tuhan. (Merry Riana)'),
(205, 'Kapasitas masa depanmu bergantung pada buku apa yang kamu baca dan dengan siapa kamu bergaul. (Bong Chandra)'),
(206, 'Ada uang gak boleh sombong, gak punya uang juga gak boleh nyolongGak banyak uang juga jangan suka bohong. (Jusuf Hamka)'),
(207, 'Anak muda memang minim pengalaman, karena itu ia tak tawarkan masa lalu, anak muda menawarkan masa depan. (Anies Baswedan)'),
(208, 'Janganlah kau tuntut Tuhanmu karena tertundanya keinginanmu, tetapi tuntutlah dirimu sendiri karena engkau telah menunda adabmu kepada Allah. (Ibnu Atha illah)'),
(209, 'Seseorang akan menjadi hebat jika dan hanya ia berusaha sesuai dengan apa yang ia minati. (Benjamin Disraeli - Coningsby)'),
(210, 'Masa depanmu diciptakan oleh apa yang kamu kerjakan hari ini, bukan besok. (Robert Kiyosaki)'),
(211, 'Kita semua harus menanggung salah satu dari dua hal ini, derita disiplin atau sakitnya penyesalan. (Jim Rohn)'),
(212, 'Kemauan adalah kunci suksesOrang-orang sukses, berusaha keras apa pun yang mereka rasakan dengan menerapkan keinginan mereka untuk mengatasi sikap apatis, keraguan, atau ketakutan. (Dan Millman)'),
(213, 'Satu-satunya cara untuk melakukan pekerjaan yang hebat adalah dengan mencintai apa yang kamu lakukan. (Steve Jobs)'),
(214, 'Yang membuatku terus berkembang adalah tujuan-tujuan hidupku. (Muhammad Ali)'),
(215, 'Pemimpin tak lahir karena ijazah, tapi oleh kerja keras dan kepedulian yang terus diasah. (Najwa Shihab)'),
(216, 'Berhati-hatilah dengan apa yang kamu inginkan karena saat kamu meminta hujan, kamu harus berurusan dengan lumpurnya juga. (Denzel Washington)'),
(217, 'Orang hebat tidak dihasilkan dari kemudahan, kesenangan, dan kenyamananMereka dibentuk melalui kesulitan, tantangan, dan air mata. (Dahlan Iskan)'),
(218, 'Orang yang melakukan lebih banyak dari bayaran yang diperolehnya segera akan memperoleh bayaran lebih banyak dari pekerjaannya yang dilakukannya. (Napoleon Hill)'),
(219, 'Temukan pekerjaan yang kamu cntai dan kamu tidak perlu lagi bekerja sehari pun dalam hidupmu. (Konfusius)'),
(220, 'Setiap bertemu dengan orang baru, saya selalu  mengosongkan gelas  terlebih dahulu.'),
(221, 'Jika gajimu adalah satu-satunya sumber penghasilanmu, kamu tinggal selangkah lagi menujukemiskinan. (Warren Buffett)'),
(222, 'Orang goblok itu gak banyak mikir yang penting melangkahOrang pintar kebanyakan mikir akibatnya tidak pernah melangkah. (Bob Sadino)'),
(223, 'Keberhasilan bukanlah milik orang pintarNamun keberhasilan itu adalah milik mereka yang senantiasa berusaha. (BJ Habibie)'),
(224, 'Banyak orang tanya,  bisnis apa yang bagus?  Jawabannya, bisnis yang bagus adalah yang dibuka, bukan ditanyakan terus. (Bob Sadino)'),
(225, 'Jangan malu dengan pekerjaan atau usahamuTidak ada yang akan memberimu makan jika kamu jatuh miskin. (Tom Hardy)'),
(226, 'Jika kamu ingin terlihat bagus di depan ribuan orang, kamu harus berlath ribuan kali di depan dirimu sendiri. (Christiano Ronaldo)'),
(227, 'Kesempatan itu seperti matahari terbitKetika Anda menunggu terlalu lama, Anda akan kehilangannya. (William Arthur Ward)'),
(228, 'Jika kamu melakukan yang terbaik dan bahagia, kamu lebih maju dalam hidup daripada kebanyakan orang. (Leonardo DiCaprio)'),
(229, 'Berlomba-lomba dalam kerja keras agar menjadi yang terbaikDemi kebahagiaan keluarga.'),
(230, 'Manusia itu memiliki potensi dan kesempatan yang sama pulaMaka jangan menyerah untuk terus berusaha mendapatkan yang terbaik.'),
(231, 'Sekarang bukan waktunya untuk mengeluh apalagi menyerahNamun setiap momen adalah untuk bekerja.'),
(232, 'Melihat cahaya matahari merupakan tanda bahwa Tuhan masih memberikan kita kesempatan untuk bekerja.'),
(233, 'Jalan untuk mendapatkan kesuksesan memang banyakNamun untuk mendapatkan harta yang berkah kamu perlu racikan khusus untuk itu, yakni doa dan kerja keras.'),
(234, 'Jadilah unik saat dirimu bekerja agar kamu terlihatLebih baik menjadi aneh namun bermanfaat daripada ikut-ikutan kebanyakan orang tapi merugikan.'),
(235, 'Bekerjalah dengan baik agar kamu juga akan dipertemukan dengan orang yang baik pula.'),
(236, 'Hal yang berat dalam hidup ini adalah memulai sesuatuNamun ada juga yang tidak kalah berat yakni berusaha kontinu melakukan usahanya.'),
(237, 'Tahapan untuk meraih kesuksesan itu panjangDari persiapan, percobaan, ujian, dan kemenangan.'),
(238, 'Kerja itu sebuah kenikmatan yang tiada terkira rasanyaTapi banyak orang yang malas bekerja karena dirinya tidak mau merasakan kenikmatan tersebut.'),
(239, 'Pemimpin berpikir dan berbicara tentang solusiPengikut berpikir dan berbicara tentang masalah. - Brian Tracy'),
(240, 'Dalam kesuksesan, kemauan kamu untuk sukses harus lebih besar daripada ketakutan kamu akan kegagalan. - Bill Cosby'),
(241, 'Jangan pernah menyerah dan mengasihani diri sendiri. Ciputra'),
(242, 'Setiap bertemu dengan orang baru, saya selalu mengosongkan gelas saya terlebih dahulu. -Bob Sadino'),
(243, 'Janganlah pernah menyerah ketika Anda masih mampu berusaha lagiTidak ada kata berakhir sampai Anda berhenti mencoba. -Brian Dyson'),
(244, 'Jangan menyerahMenderitalah sekarang dan hiduplah sebagai juara nantinya. -Muhammad Ali'),
(245, 'Tidak ada yang bisa membuatmu merasa rendah diri tanpa seizinmu. - Eleanor Roosevelt'),
(246, 'Bekerjalah saat waktunya bekerja, bermainlah saat waktunya bermainHal tersebut adalah aturan dasar dari kedisiplinan diri yang represif. (Theodor Adorno)'),
(247, 'Hidup ini terjadi di alam tindakan, bukan di alam rencanaLebih bertindaklahUntuk apa malam bersemangat menggebu-gebu tentang rencanamu, lalu menunda semuanya di pagi hari? Lebih bertindaklah! -Mario Teguh'),
(248, 'Bekerjalah 2 atau 3 kali lebih banyak dari orang lain, karena usaha tidak pernah membohongi hasil. (Chairul Tanjung)'),
(249, 'Dalam hidup kamu akan bertemu dua jenis orang, orang yang membangunmu, dan orang yang menjatuhkanmuNamun pada akhirnya kamu akan berterima kasih kepada mereka berdua.'),
(250, 'Orang hebat akan selalu ditemukan sendirianOrang lemah akan selalu ditemukan dalam keramaian.'),
(251, 'Banyak orang mengeluh karena merasa pekerjaannya itu bebanTapi mereka lupa jika lebih banyak orang yang lebih terbebani karena butuh pekerjaan.'),
(252, 'Bekerja itu bukan soal bisa atau tidak bisa, tapi soal mau atau tidak mau dan soal serius atau tidak serius.'),
(253, 'Singa tidak akan pernah memakan tumput walaupun ia sangat laparJadilah seperti singa, jangan pernah menurunkan standar kamu karena orang lain.'),
(254, 'Tidak ada waktu untuk menyesal terlalu lama, gunakan waktu Anda untuk bangkit dan kembali maju.'),
(255, 'Menyepi itu penting, supaya kamu benar-benar bisa mendengar apa yang menjadi isi keramaian.'),
(256, 'Jangan sampai kamu menyesal di hari tua karena kamu tidak melakukan apa yang seharusnya kamu lakukan sekarang.'),
(257, 'Mumpung masih muda, banyakin action, perbesar omzet, kurangi mengeluh, dan perbanyak relasi.'),
(258, 'Jangan resign dari pekerjaanmu untuk membangun bisnisTapi bangunlah bisnis agar kamu bisa resign dan bebas dari pekerjaanmu.'),
(259, 'Tanpa bekerja, semua kehidupan akan membusukTetapi ketika bekerja tanpa jiwa, maka kehidupan akan tercekik dan mati. (Albert Camus)'),
(260, 'Tak ada rahasia untuk menggapai suksesSukses itu dapat terjadi karena persiapan, kerja keras, dan mau belajar dari kegagalan.- Colin Powell'),
(261, 'Terima tanggung jawab dalam hidupmuKetahuilah bahwa kamu lah yang akan membawa dirimu ke mana kamu ingin pergi, bukan orang lain. (Les Brown)'),
(262, 'Kesuksesan bersumber dari perbuatanOrang yang sukses terus melakukan usahaOrang sukses bahkan membuat kesalahan, namun mereka tidak berhenti usaha. (Cobrad Hilton)'),
(263, 'Dorong dirimu sendiri, karena tidak ada orang lain yang akan melakukannya untukmu.'),
(264, 'Bekerja keraslah dalam kesunyian, biarkan kesuksesanmu menjadi kebisingan.'),
(265, 'Bekerjalah seperti ada seseorang yang bekerja dua puluh empat jam sehari untuk mengambilnya darimu.'),
(266, 'Pemimpin terbesar belum tentu orang yang melakukan hal-hal terbesarDia adalah orang yang membuat orang-orang melakukan hal-hal terbesar. - Ronald Reagan'),
(267, 'Berlomba-lomba dalam kerja keras agar menjadi yang terbaikDemi kebahagiaan keluarga.'),
(268, 'Manusia itu memiliki potensi dan kesempatan yang sama pulaMaka jangan menyerah untuk terus berusaha mendapatkan yang terbaik.'),
(269, 'Sekarang bukan waktunya untuk mengeluh apalagi menyerahNamun setiap momen adalah untuk bekerja.'),
(270, 'Melihat cahaya matahari merupakan tanda bahwa Tuhan masih memberikan kita kesempatan untuk bekerja.'),
(271, 'Jalan untuk mendapatkan kesuksesan memang banyakNamun untuk mendapatkan harta yang berkah kamu perlu racikan khusus untuk itu, yakni doa dan kerja keras.'),
(272, 'Jadilah unik saat dirimu bekerja agar kamu terlihatLebih baik menjadi aneh namun bermanfaat daripada ikut-ikutan kebanyakan orang tapi merugikan.'),
(273, 'Bekerjalah dengan baik agar kamu juga akan dipertemukan dengan orang yang baik pula.'),
(274, 'Hal yang berat dalam hidup ini adalah memulai sesuatuNamun ada juga yang tidak kalah berat yakni berusaha kontinu melakukan usahanya.'),
(275, 'Tahapan untuk meraih kesuksesan itu panjangDari persiapan, percobaan, ujian, dan kemenangan.'),
(276, 'Kerja itu sebuah kenikmatan yang tiada terkira rasanyaTapi banyak orang yang malas bekerja karena dirinya tidak mau merasakan kenikmatan tersebut.'),
(277, 'Untuk bisa sukses, kamu tidak perlu wajah yang tampan atau tubuh yang heroik, yang kamu butuhkan adalah otak yang penuh ide dan kemampuan untuk tampil. (Rowan Atkinson)'),
(278, 'Penghargaan paling tinggi bagi seorang pekerja keras bukanlah apa yang dia peroleh dari pekerjaan itu, tapi seberapa berkembang ia dengan kerja kerasnya itu. (John Ruskin)'),
(279, 'Tak ada rahasia untuk menggapai suksesSukses itu dapat terjadi karena persiapan, kerja keras, dan mau belajar dari kegagalan. (Colin Powell)'),
(280, 'Seseorang akan menjadi hebat jika dan hanya ia berusaha sesuai dengan apa yang ia minati. (Benjamin Disraeli-Coningsby)'),
(281, 'Pemimpin terbesar belum tentu orang yang melakukan hal-hal terbesarDia adalah orang yang membuat orang-orang melakukan hal-hal terbesar. (Ronald Reagan)'),
(282, 'Tanpa bekerja, semua kehidupan akan membusukTetapi ketika bekerja tanpa jiwa, maka kehidupan akan tercekik dan mati. (Albert Camus)'),
(283, 'Pemimpin berpikir dan berbicara tentang solusiPengikut berpikir dan berbicara tentang masalah. (Brian Tracy)'),
(284, 'Gagal itu makanan sehari-hariItu biasa, yang penting bagimana (kamu) menyikapinyaEvaluasiBangkitGagal lagi? Bangkit lagi! (Chairul Tanjung)'),
(285, 'Terima tanggung jawab dalam hidupmuKetahuilah bahwa kamulah yang akan membawa dirimu ke mana kamu ingin pergi, bukan orang lain. (Les Brown)');
